      SELECT DISTINCT - col1 AS col0 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT NULL NOT BETWEEN 56 / col1 / + - col0 / + col0 AND 61 * ( 75 ) + - 37;
  - name: tab2

outputs:
  - name: q13503.out
    data: |
